const BookList = ({ reservations }) => {


    return (
        <>
            <h1>my rezervations</h1>
            <ul>
                {
                    reservations.map(rez =>{
                        let date_begin=new Date(rez.data_start);
let date_end=new Date(rez.data_end);
let differenceInTime= date_end.getTime()- date_begin.getTime();
let differenceInDays=Math.round(differenceInTime/(1000*3600*24));
return(
                        <li>
                            <p>tara: {rez.tara}, oras: {rez.oras}, suprafata:{rez.suprafata}, </p>
                            <p>start: {rez.data_start}, end: {rez.data_end}</p>
                            <p>owner: {rez.owner}</p>
                            <p>price: {differenceInDays* rez.price}</p>
                        </li>)})

                }
            </ul>

        </>
    )
}

export default BookList;
